class ListNode:
	def __init__(self, x):
		self.val = x
		self.next = None

def merge(lHead, lNum, rHead, rNum):
	head = p = None
	# divide and conquer, deal with sub sequence
	lp = sort(lHead, lNum)
	rp = sort(rHead, rNum)
	# merge
	while lp != None and rp != None:
		if head == None:
			if lp.val < rp.val:
				head = lp
				p = head
				lp = lp.next
				p.next = None
			else:
				head = rp
				p = head
				rp = rp.next
				p.next = None
		else:
			if lp.val < rp.val:
				p.next = lp
				lp = lp.next
				p = p.next
				p.next = None
			else:
				p.next = rp
				rp = rp.next
				p = p.next
				p.next = None
	# deal with the rest nodes
	while lp != None:
		p.next = lp
		p = p.next
		lp = lp.next
		p.next = None
	while rp != None:
		p.next = rp
		p = p.next
		rp = rp.next
		p.next = None
	return head

def sort(head, numOfNodes):
	# only one node or only one node
	if head == None or head.next == None:
		return head
	# find the start of right link
	rNum = numOfNodes / 2
	lNum = numOfNodes - rNum
	lHead = rHead = head
	tempNode = None
	tempCount = lNum
	while tempCount != 0:
		tempNode = rHead
		rHead = rHead.next
		tempCount -= 1
	if tempNode != None:
		tempNode.next = None
	# merge
	head = merge(lHead, lNum, rHead, rNum)
	return head

def sortList(head):
	# count length of the link
	p = head
	numOfNodes = 0
	while p != None:
		numOfNodes += 1
		p = p.next
	return sort(head, numOfNodes)

